import React, {FC} from 'react';
import {Offcanvas} from "react-bootstrap";
import {useDispatch} from "react-redux";
import {TabsPagesActionType} from "../../types/typeTabsPages";

interface IAccountNavBar {
    setShowData: (showData: boolean) => void;
    setShowOrder: (showOrder: boolean) => void;
    setShowHistoryOrder: (showHistoryOrder: boolean) => void;
}

const AccountNavBar: FC<IAccountNavBar> = ({setShowData, setShowOrder, setShowHistoryOrder}) => {
    const dispatch = useDispatch();
    const Data = () => {dispatch({
        type: TabsPagesActionType.FLIP_BOOKMARK_ACCOUNT,
        payload: {data: true, order: false, historyOrder: false}
    })}
    const Order = () => {setShowData(false); setShowOrder(true); setShowHistoryOrder(false);}
    const HistoryOrder = () => {setShowData(false); setShowOrder(false); setShowHistoryOrder(true);}


    return (
            <div style={{display: "flex", justifyContent: "center"}}>
                <button type={"button"} onClick={Data}>
                    Особисті дані
                </button>
                <button type={"button"} onClick={Order}>
                    Поточне замовлення
                </button>
                <button type={"button"} onClick={HistoryOrder}>
                    Історія замовлень
                </button>
            </div>
    );
};

export default AccountNavBar;
